import { StyleSheet, StatusBar } from 'react-native';

export const globalStyles = StyleSheet.create({
	container: {
		marginTop: StatusBar.currentHeight,
		flex: 1,
		backgroundColor: 'white'
	},
	mainColor: {
		color: '#1cd777'
	}
});
